const CategoryMenu = () => {
  const [selectedCategory, setSelectedCategory] = useState(null);
  const [selectedDomain, setSelectedDomain] = useState(null);

  const handleChange = (e) => {
    const { value } = e.target;
    setSelectedCategory(categories.find((category) => category.name === value));
  };

  const handleDomainClick = (e, domain) => {
    e.preventDefault();
    setSelectedDomain(domain);
  }

  return (
    <div className="category-dropdown">
      <a name="category"></a>
      <h2 className="text-with-heading__heading">Выберете домен, который поможет Вам выиграть.</h2>
      <select className="category-dropdown__select" onChange={handleChange}>
        <option value="">Выберите категорию</option>
        {categories.map((category) => (
          <option key={category.name} value={category.name}>
            {category.name}
          </option>
        ))}
      </select>

      {selectedCategory && (
        <div className="category-details">
          <h3 className="category-details__title">{selectedCategory.name}</h3>
          <div className="category-details__domains">
            {selectedCategory.domains.map((domain) => (
              <a key={domain.name} href={`http://${domain.name}`} onClick={(e) => handleDomainClick(e, domain)}>
                {domain.name}
              </a>
            ))}
          </div>
        </div>
      )}
      {selectedDomain && (
        <Modal onClose={() => setSelectedDomain(null)}>
          <h2>{selectedDomain.name}</h2>
          <p>{selectedDomain.description}</p>
        </Modal>
      )}
    </div>
  );
};

export default CategoryMenu;